export default async function runEx(options: any): Promise<any> {
    log('开始...');
    runStartDate = new Date().getTime();

    argvUrl = options.url;
    argvOutput = options.output;
    argvWaitTime = options.waitTime;
    /** 放款日期 */
    argvLoanDate = options.loanDate;
    /** 首次垫付日期 */
    argvStartAdvanceDate = options.startAdvanceDate;
    /** 末次垫付日期 */
    argvEndAdvanceDate = options.endAdvanceDate;
    /** 产品代码 */
    argvProductCode = options.productCode;
    /** 合同编号 */
    argvContractNo = options.contractNo;

    coreBrowser = await playwright.chromium.launch();
    const context = await coreBrowser.newContext();
    corePage = await context.newPage();
    await corePage.goto(argvUrl);

    await initSettings();
    log('页面加载成功...');
    log('');

    await parseAccInfoMenu(async () => {
        await recursiveParseTransDetailMenu(0, 'loan', async () => {
            await recursiveParseTransDetailMenu(0, 'advance',
                async () => await exitProgram(true),
                async () => await exitProgram(false));
        }, async () => await exitProgram(false));
    }, async () => await exitProgram(false));
}

async function initSettings() {
    if (!argvUrl) {
        error('error', '需要设置抓取URL！');
        await exitProgram(false);
    }
    if (!argvOutput) {
        error('error', '需要设置输出地址！');
        await exitProgram(false);
    }

    argvWaitTime = argvWaitTime || 1000;
    maxQueryDay = Math.ceil(dateDiff(argvStartAdvanceDate, argvEndAdvanceDate) / QUERY_MAX_DAYS);

    log('');
    log('>>>>>>>>> 基本设置 <<<<<<<<<');
    log('目标地址：\t\t', argvUrl);
    log('输出目录：\t\t', argvOutput);
    log('放款日期：\t\t', argvLoanDate);
    log('首次垫付日期：\t', argvStartAdvanceDate);
    log('末次垫付日期：\t', argvEndAdvanceDate);
    log('产品代码：\t\t', argvProductCode);
    log('合同编号：\t\t', argvContractNo);
    log('重试时间：\t\t', `${RETRY_INTERVAL} ms`);
    log('重试次数：\t\t', RETRY_NUMBER);
    log('页数获取时间：\t', `${PAGE_ITEM} ms`);
    log('渲染宽度：\t\t', `${RENDER_WIDTH} px`);
    log('>>>>>>>>> 基本设置 <<<<<<<<<');
    log('');
}

/** 解析账户总览并生成图片 */
async function parseAccInfoMenu(success: Function, fail: Function) {
    log('>>>>>>>>> 开始解析[账户总览] <<<<<<<<<');
    let ret: any = await simulatedClick('accInfoMenu');
    if (ret === -1) fail();

    ret = await corePage.evaluate(function () {
        let ifm: any = document.getElementById('pageSelect');
        if (!ifm) return {status: '-1'};
        let nDocument = ifm.contentWindow.document;
        if (!nDocument) return {status: '-1'};
        let clr8e1 = nDocument.getElementsByClassName('clr_8e')[1];
        if (!clr8e1) return {status: '-1'};
        let clr8e2 = nDocument.getElementsByClassName('clr_8e')[2];
        if (!clr8e2) return {status: '-1'};
        let account = clr8e1.innerText || '';
        let accountName = clr8e2.innerText || '';
        return {status: '200', data: {account: account, accountName: accountName}};
    } as any);
    console.log("执行..", ret);
    if (ret.status === "200") {
        userAccount = ret.account;
        userAccountName = ret.accountName;
        await setScrollHeight();
        await corePage.screenshot({path: getOutputPath(argvContractNo + '-1账号.png')});
        log('渲染成功，文件路径：' + getOutputPath(argvContractNo + '-1账号.png'));
        log('');
        await success();
    } else {
        await fail();
    }
}

/**
 * 解析交易明细并生成图片
 * @maxNum 递归基础 传 0
 * @mode loan 放款、advance 垫付
 */
async function recursiveParseTransDetailMenu(maxNum: number, mode: string, success: Function, fail: Function) {
    log(`>>>>>>>>> 开始解析[${mode === 'loan' ? ' 放  款 ' : ' 垫  付 '}] <<<<<<<<<`);
    if (mode === 'loan') {
        if (maxNum > 0) return success();
    } else {
        if (maxNum >= maxQueryDay) return success();
    }

    async function nativeFun() {
        log("nativeFun 执行了... ");
        await setStartDateAndEndDateAndRefreshPage(maxNum, mode, async (startDate: string, endDate: string) => {
            log(`模式：${mode === 'loan' ? '[放款]' : '[垫付]'}，开始时间：${startDate}，结束时间：${endDate}`);
            ++maxNum;
            await getTotalPage(async (page: number) => {
                totalPage = page;
                log(`模式：${mode === 'loan' ? '[放款]' : '[垫付]'}，最大页数：${totalPage}`);
                await nextTransDetailPage(maxNum, mode, startDate, endDate, async () => {
                    await recursiveParseTransDetailMenu(maxNum, mode, success, fail);
                }, () => fail());
            }, () => fail());
        }, () => {
            fail();
        });
    }

    currentPage = 1;
    if (maxNum === 0) {
        log('首次，进行菜单切换...');
        let ret = await simulatedClick('transDetailMenu');
        if (ret === -1) fail();
        await nativeFun();
    } else {
        log('已切换到指定菜单，跳过...');
        await nativeFun();
    }
}

