/** 渲染HTML，并生成图片 */
function renderHtml(maxNum: number, mode: string, startDate: string, endDate: string) {
    setScrollHeight();
    let filePrefix = '';
    if (mode === 'loan') {
        filePrefix = '2放款流水';
    } else {
        filePrefix = '3垫付流水';
    }
    log('准备完成，开始渲染...');
    let fileName = argvContractNo + '-' + filePrefix + '-' + startDate + '-' + endDate + '-PAGE-' + currentPage + '.png';
    corePage.render(getOutputPath(fileName));
    log('渲染成功，文件路径：' + getOutputPath(fileName));
    log('');
}

/**
 * 模拟点击
 * @return -1 失败，其余成功
 */
function simulatedClick(elementId: string): number {
    return corePage.evaluate(function (elementId) {
        let itemEnum = document.getElementById(elementId);
        if (itemEnum) itemEnum.click();
        else return -1;
    } as any, elementId);
}

/**
 *  pollView(0, function (a, b) {
 *    return {status: "200", data: {username: "test"}};
 *  }, (data: any) => {
 *    console.log("成功:", data.username);
 *  }, () => {
 *    console.log("失败");
 *  }, "1", "10");
 *
 * @param tag
 * @param count
 * @param fun
 * @param success
 * @param fail
 * @param art
 */
async function pollView(tag: string, count: number, fun: Function, success: Function, fail: Function, ...art) {
    await setTimeout(async () => {
        let ret = fun(...art);
        if (count > RETRY_NUMBER) {
            await fail(ret.data, ret);
            return;
        }
        if (ret.status === '200') {
            log(`${tag}，已获取到指定元素，重试次数：${count}`);
            await success(ret.data);
        } else {
            ++count;
            log(`${tag}，未获取到指定元素，重试[${count}]`);
            await pollView(tag, count, fun, success, fail, ...art);
        }
    }, RETRY_INTERVAL);
}

/** 添加头图 */
function addHeaderImage(): Function {
    return function () {
        document.getElementsByTagName('body')[0].insertBefore((function () {
            let b = document.createElement('div');
            b.innerHTML =
                '<img style=\'width: 100%;\' src=\'data:image/png;base64,\'>';
            return b;
        })(), (function () {
            return document.getElementsByTagName('body')[0].children[0];
        })());
    };
}

/** 获得 HTML BODY 的高度*/
function getScrollHeight(): Function {
    return () => {
        return document.getElementsByTagName('body')[0].scrollHeight;
    };
}

/** 设置 HTML BODY 的高度*/
async function setScrollHeight() {
    let scrollHeight = await corePage.evaluate(getScrollHeight());
    corePage.clipRect = {top: 0, left: 0, width: RENDER_WIDTH, height: scrollHeight};
}

/**
 * 减免天数
 * @param reDay 183的倍数，如果不减免就传0
 * @param start
 * @param end
 */
function getStartAndEndDate2(reDay: number, start: string, end: string): any {
    let r = {startDate: '', endDate: ''};
    let s = new Date(end);
    s.setDate(s.getDate() - (QUERY_MAX_DAYS * (reDay + 1) - 1));
    let sD = new Date(start);
    if (s.getTime() <= sD.getTime()) s = sD;

    let e = new Date(end);
    e.setDate(e.getDate() - (QUERY_MAX_DAYS * reDay));
    r.startDate = dataCompletion(s.getFullYear()) + dataCompletion(s.getMonth() + 1) + dataCompletion(s.getDate());
    r.endDate = dataCompletion(e.getFullYear()) + dataCompletion(e.getMonth() + 1) + dataCompletion(e.getDate());
    return r;
}

/**
 * 获取放款日期，传入一个日期，然后获取前后 5 天的区间
 * @date 传入一个时间，计算区间
 */
function getLoanDate(date: string) {
    let r = {startDate: '', endDate: ''};
    let s = new Date(date);
    s.setDate(s.getDate() - 5);
    let e = new Date(date);
    e.setDate(e.getDate() + 5);
    r.startDate = dataCompletion(s.getFullYear()) + dataCompletion(s.getMonth() + 1) + dataCompletion(s.getDate());
    r.endDate = dataCompletion(e.getFullYear()) + dataCompletion(e.getMonth() + 1) + dataCompletion(e.getDate());
    return r;
}

/**
 * 获取两个时间之间的天数
 * @param sDate1
 * @param sDate2
 */
function dateDiff(sDate1, sDate2) {
    let oDate1, oDate2, iDays;
    oDate1 = new Date(sDate1);
    oDate2 = new Date(sDate2);
    // @ts-ignore
    iDays = parseInt(Math.abs(oDate1 - oDate2) / 1000 / 60 / 60 / 24);
    return iDays;
}


/** 个位数补0 */
function dataCompletion(data: number): string {
    if (Number(data) < 10) return '0' + data;
    return String(data);
}

